"use strict";(self.webpackChunkexonumia_cc=self.webpackChunkexonumia_cc||[]).push([[36752],{31379:(n,t,o)=>{o.r(t),o.d(t,{data:()=>e});const e={key:"v-63f6d027",path:"/nga/yo/museum/re-bitcoin-v0.1-released/",title:"Ní orí ọ̀ rọ̀ : A gbé ẹ̀ yà Bitkoini àkọ́ kọ́ (v.01) jáde",lang:"yo",frontmatter:{translators:[{name:"Oladele Falese",href:"https://twitter.com/olladave"}],supporters:[{name:"BitMEX",href:"https://blog.bitmex.com/bitmex-grant-translation-of-bitcoin-content-into-african-languages/"}]},excerpt:"",headers:[],filePathRelative:"nga/yo/museum/re-bitcoin-v0.1-released/README.md",git:{updatedTime:1761164621e3}}},42902:(n,t,o)=>{o.r(t),o.d(t,{default:()=>k});var e=o(66252);const r=(0,e._)("h1",{id:"ni-ori-o-ro-a-gbe-e-ya-bitkoini-ako-ko-v-01-jade",tabindex:"-1"},[(0,e._)("a",{class:"header-anchor",href:"#ni-ori-o-ro-a-gbe-e-ya-bitkoini-ako-ko-v-01-jade","aria-hidden":"true"},"#"),(0,e.Uk)(" Ní orí ọ̀ rọ̀ : A gbé ẹ̀ yà Bitkoini àkọ́ kọ́ (v.01) jáde")],-1),a=(0,e.Uk)("Láti ọwọ́ Hal Finney "),i={href:"https://web.archive.org/web/20190712071421/https://www.mail-archive.com/cryptography@metzdowd.com/msg10152.html",target:"_blank",rel:"noopener noreferrer"},l=(0,e.Uk)("2009/01/11"),b=(0,e.uE)("<p>Satoshi Nakamoto kọ:</p><blockquote><p>À ń kéde àkọ́ kọ́ jáde Bitkoini, ètò owó ẹ̀ rọ orí kọ̀ mpútà titun, ètò owó ẹ̀ rọ orí kọ̀ mpútà titun, tí ó n lo ìtàkù orí-ò-orí láti dí nínọ́ owó lẹ́ẹ̀mejì. Ó jẹ́ èyí tí ó ní alákòóso púpọ̀, tí ò ní olùpín tàbí aláṣẹ àtòkèwá</p><p>Lọ sí bitcoin.org fún àwọn àwòrán.</p><p>Ìtọ́kasí ẹ̀dà rẹ̀ rè é: http://downloads.sourceforge.net/bitcoin/bitcoin-0.1.0.rar</p></blockquote><p>A kí Satoshi kú oríre fún àgbéjáde àkọ́ kọ́. Mò n retí láti gbìyànjú ẹ.</p><blockquote><p>Gbogbo ìṣọ̀ yíká lápapọ̀ jẹ́ ẹyọ owó mílíọ́ nù mọ́ kànlélógún. A ma pin fún ìkoríta ìtàkùn tí wọ́ n bá ti ṣe búlọ́kù, ó ma ma ṣe ìdajì oye tí ó jẹ́ ní gbogbo ọdún mẹ́rin.</p><p>ọdún mẹ́rin àkọ́kọ́: mílíọ́nù mẹ́wàá àti ẹ̀dẹ́gbẹ̀ta ẹyọ owó ọdún mẹ́ rin tó tèle: mílíọ́ nù márùń àti igba ó lé ládọ́ ta ẹyọ owó ọdún mẹ́rin tó tèle: mílíọ́nù méjì àti ẹgbẹ̀ta ẹgbẹ̀rún lé ní árùńdínlógún ẹyọ owó ọdún mẹ́rin tó tèle: mílíọ́nù kan àti ọ̀kẹ́ mẹ́ta lé ní ẹgbàá méjìlá ẹyọ owó àti bẹ́ẹ̀bẹ́è lọ...</p></blockquote><p>Ó da wípé a lè ṣe ètò náà láti lè ní oye ẹyọ owó tí a lè tẹ̀ jáde. Mo rò ó wípé tó bá yá, oye iṣé tí èyàn ní láti ṣe kí ó lè tẹ ẹyọ owó titun ma ṣòro si.</p><p>Ìṣòro tí a ma kọ́kọ́ ni pẹ̀lú owó titun ni bí a ṣe ma bu iyì fun. Ka ti ẹ̀ ní a gbójú kúrò ní ìṣòro pé kò sí ẹni tí ó ma gbà á ní àkọ́ kọ́ , ìṣòro bí a ṣe ma mọ oye kan pàtó tí ó bójúmu fún àwọn ẹyọ owó wọ̀nyí ṣì wà.</p><p>Bí kí ló bá jáde, wò ó pé bitkoini ní àṣeyọrí àti pé ó wá di ètò ìsanwó tí ó gbinlẹ̀ káàkiri gbogbo àgbáyé. Nígbà náà gbogbo oye owó lápapọ̀ yẹ kó dọ́ gba pọ̀ mọ gbogbo oye ọrọ àgbáyé. Ìfojúwọ̀ n ọrọ̀ ìdílé gbogbo àgbáyé lápapọ̀ lọ́ wọ́ lọ́ wọ́ tí mo rí wà láti bí ọgọ́ run tírílíọ́ nu sí ọdúnrun tírílíọ́ nu dọ́ lásì. Pẹ̀ lú ẹyọ owó ogún mílíọ́ nù, bí mílíọ́ nù mẹ́ wá ni ẹyọ owó kan ma jẹ́.</p><p>Nítorí bẹ́ pé ó ṣeṣe lóní pé a lè tẹ ẹyọ owó pẹ̀lú àkokò díẹ̀ lé jẹ́ ǹkan tí èyàn fẹ́ ṣe, pẹ̀lú àṣeyọrí ti ǹkan bí ọgọ́ rún mílíọ́ nù sí ẹyọ kan! Tí ó bá tilẹ̀ jẹ́ pé àyè àṣeyọrí bitkoini dé ìwọ̣̀ n yẹn kéré, ṣé nítòótọ́ ni wọ́ n tó ọgọ́ rún mílíọ́ nù sí ẹyọ kan? Ìyẹn jẹ́ ǹkan láti ronú sí...</p><p>Hal</p><hr><p>The Cryptography Mailing List Unsubscribe by sending &quot;unsubscribe cryptography&quot; to majord...@metzdowd.com</p>",11),p={},k=(0,o(83744).Z)(p,[["render",function(n,t){const o=(0,e.up)("OutboundLink"),p=(0,e.up)("LanguageDropdown");return(0,e.wg)(),(0,e.iD)(e.HY,null,[r,(0,e._)("p",null,[a,(0,e._)("a",i,[l,(0,e.Wm)(o)])]),(0,e.Wm)(p),b],64)}]])},83744:(n,t)=>{t.Z=(n,t)=>{const o=n.__vccOpts||n;for(const[n,e]of t)o[n]=e;return o}}}]);